import { useForm } from "react-hook-form";
import { AddUserContainer, ButtonContainer } from "./styles";

const AddUser = () => {

    const { register, handleSubmit, watch, formState: { errors } } = useForm();

    return(
        <AddUserContainer>
            <form>
                <input {...register("firstName",{required: true})} type="text" placeholder="Name"/>
                <input {...register("surname",{required: true})} type="text" placeholder="Surname"/>
                <input {...register("role",{required: true})} type="text" placeholder="Role"/>
                <input {...register("date",{required: true})} type="date" placeholder="Date of Birth"/>
            </form>
            <ButtonContainer>
                <button type="submit">Add</button>
            </ButtonContainer>
        </AddUserContainer>
    )
}

export default AddUser;
